import React from 'react';
import ReactDom from 'react-dom';
import './index.css';
const animes = [
  {
    img: 'data:image/jpeg;base64,',
    title: 'Naruto',
    rating: 'Rating: 8'
  }
  ,
  {
    img: 'data:image/jpeg;base64,',
    title: 'FullMetal Alchemist BrotherHood',
    rating: 'Rating: 9'
  }
  ,
  {
    img: 'data:image/jpeg;base64,',
    title: 'Death Note',
    rating: 'Rating: 9'
  }
];

function AnimeList(){
  return (
    <section className='animeList'>
     {animes.map((anime) => {
       return <Anime anime={anime}/>
     })}
    </section>
  );
}

const Anime = (props) => {
  const {img, title, rating} = props.anime;
  return (
  <article className='anime'>
    <img src={img}/>
    <h2>{title}</h2>
    <h4>{rating}</h4>
  </article>
  );
};

ReactDom.render(<AnimeList/>, document.getElementById('root'));